CREATE TABLE nft_metadata (
    id INT PRIMARY KEY,
    title VARCHAR(255),
    description TEXT,
    creator VARCHAR(100)
);
CREATE TABLE nft_creator (
    id INT PRIMARY KEY,
    name VARCHAR(100),
    email VARCHAR(255)
);

CREATE TABLE nft_metadata (
    nft_id UUID PRIMARY KEY,
    title VARCHAR,
    description TEXT,
    creator_name VARCHAR
);

CREATE TABLE nft_owners (
    owner_id UUID PRIMARY KEY,
    nft_id UUID REFERENCES nft_metadata(nft_id),
    owner_name VARCHAR
);

CREATE TABLE nft_transactions (
    transaction_id UUID PRIMARY KEY,
    nft_id UUID REFERENCES nft_metadata(nft_id),
    transaction_type VARCHAR,
    transaction_date TIMESTAMP
);

CREATE TABLE nft_ratings (
    rating_id UUID PRIMARY KEY,
    nft_id UUID REFERENCES nft_metadata(nft_id),
    rating_value INTEGER,
    rated_by VARCHAR
);

CREATE TABLE NFT_Metadata (
   nft_id INT PRIMARY KEY,
   title VARCHAR(100),
   description TEXT,
   creator_name VARCHAR(50)
);

CREATE TABLE NFT_Images (
   nft_image_id INT PRIMARY KEY,
   nft_id INT,
   image_url VARCHAR(255)
);

CREATE TABLE NFT_Owners (
   nft_id INT,
   owner_address VARCHAR(100),
   purchase_date DATE
);

CREATE TABLE NFT_Tags (
   nft_id INT,
   tag_name VARCHAR(50)
);

CREATE TABLE NFT_Stats (
   nft_id INT,
   views INT,
   likes INT
);
